import React from 'react'
import {Menu, SubMenu,Icon} from 'antd'
import './index.less'
import Qs from "qs"
import axios from 'axios'
const MenuItem = Menu.item
axios.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded';
const MyIcon = Icon.createFromIconfontCN({
    scriptUrl: '//at.alicdn.com/t/font_977200_ggwbeu0be67.js',
});

class SiderComponent extends React.Component{
    componentDidMount(){
        axios.post("/manage/backUser/checkLogin",Qs.stringify({
            userPhone:15855496761
        })).then(res => {
                console.log(res)
            })
    }
    render(){
        return (
            <div className="logo" >
                <MyIcon className="logoIcon" type="icon-daikuan"/>
                <p>现金贷</p>
            </div>
        )
    }
}
export default SiderComponent;
